class NotificationModel {  String? result;  List<Records>? records;  int? totalRecordCount;  NotificationModel({this.result, this.records, this.totalRecordCount});  NotificationModel.fromJson(Map<String, dynamic> json) {    result = json['Result'];    if (json['Records'] != null) {      records = <Records>[];      json['Records'].forEach((v) {        records!.add(new Records.fromJson(v));      });    }    totalRecordCount = json['TotalRecordCount'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['Result'] = this.result;    if (this.records != null) {      data['Records'] = this.records!.map((v) => v.toJson()).toList();    }    data['TotalRecordCount'] = this.totalRecordCount;    return data;  }}class Records {  String? title;  String? description;  String? category;  String? image;  String? location;  String? startTime;  String? endTime;  Records(      {this.title,      this.description,      this.category,      this.image,      this.location,      this.startTime,      this.endTime});  Records.fromJson(Map<String, dynamic> json) {    title = json['Title'];    description = json['Description'];    category = json['Category'];    image = json['Image'];    location = json['Location'];    startTime = json['StartTime'];    endTime = json['EndTime'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['Title'] = this.title;    data['Description'] = this.description;    data['Category'] = this.category;    data['Image'] = this.image;    data['Location'] = this.location;    data['StartTime'] = this.startTime;    data['EndTime'] = this.endTime;    return data;  }}